s not unique.','Modify the id attribute value so it is unique.','Success Criteria 4.1.1 Parsing (A)',NULL,NULL,NULL),(186,'Known','label','label element contains an input element.','Move the input element outside the label element.','WCAG 2.0(AA)',NULL,NULL,NULL),(187,'Known','body','input element has more than one associated label.','Remove or modify the label elements so there is only one associated label for each form control.','Success Criteria 3.3.2 Labels or Instructions (A)',NULL,NULL,NULL),(189,'Potential','input','label may not describe its associated control.','1. Check all input elements and view their associated label.2. Note: For information on what constitutes an associated label please see test 57.','Success Criteria 3.3.2 Labels or Instructions (A)',NULL,NULL,NULL),(190,'Known','a','Anchor element missing a title attribute.','Add a title attribute to your a (anchor) element.','WCAG 2.0(AA)',NULL,NULL,NULL),(191,'Potential','a','Anchor\'s title may not describe the link destination.','1. Check the title attribute value of each source a (anchor) element to determine if it describes the link destination.2. Note that a source a (anchor) element must contain an href attribute.','WCAG 2.0(AA)',NULL,NULL,NULL),(192,'Known','input','input element type of \"image\" uses redundant words in Alt text.','Change the Alt text for the submit button so it does not use \"submit\" or \"button\".','WCAG 2.0(AA)',NULL,NULL,NULL),(193,'Potential','input','Form submit button image may contain text that is not in Alt text.','1. For each input element that has a type attribute value of \"image\", check if the associated image contains any text.2. If the image contains text, check if the text is decorative.3. Note: For this document, \"decorative\" is defined as \"content that does not provide information, functionality, sensory experience and is neither multimedia nor time-dependent interactive\".','Success Criteria 1.1.1 Non-text Content (A)',NULL,NULL,NULL),(194,'Potential','area','area image may contain text that is not in Alt text.','1. For each area element, check if the associated image contains any text.2. If the image contains text, check if the text is decorative.3. Note: For this document, \"decorative\" is defined as \"content that does not provide information, functionality, sensory experience and is neither multimedia nor time-dependent interactive\".','Success Criteria 1.1.1 Non-text Content (A)',NULL,NULL,NULL),(195,'Known','img','Link text begins with \"link to\" or \"go to\".','Remove \"link to\" or \"go to\" at the beginning of the Alt text.','WCAG 2.0(AA)',NULL,NULL,NULL),(196,'Potential','img','Server-side image map may be used improperly.','1. Check each img element that contains a ismap attribute.2. Check if the active regions of the image map can be defined using available geometric shapes.','WCAG 2.0(AA)',NULL,NULL,NULL),(197,'Potential','a','Anchor text may not identify the link destination.','1. View the link text for each source a (anchor) element.2. Note: A source a (anchor) element must contain an href attribute.3. Note: The link text may be contained in the body text of the a (anchor) element or the Alt text of an image used as a link.','WCAG 2.0(AA)',NULL,NULL,NULL),(198,'Potential','legend','legend text may not describe the group of choices.','1. View the text contained by each legend element.2. View the group of choices associated with the legend element.','WCAG 2.0(AA)',NULL,NULL,NULL),(199,'Known','legend','legend text is empty.','Add text to the legend element.','WCAG 2.0(AA)',NULL,NULL,NULL),(200,'Likely','legend','legend text may be placeholder text.','1. View the text contained by each legend element and compare it to the list of placeholder values.\r\n2. Placeholder values are \"legend\".','WCAG 2.0(AA)',NULL,NULL,NULL),(201,'Known','frame','frame titles is empty.','Add text to the frame element\'s title attribute.','WCAG 2.0(AA)',NULL,NULL,NULL),(202,'Potential','frame','frame title contains placeholder text.','1. Check each frame element and compare its title attribute value to the list of placeholder values.\r\n2. frame title placeholder values are: \'title\', \'the title\' and \'frame title\'.','WCAG 2.0(AA)',NULL,NULL,NULL),(203,'Potential','table','Data table summary may not describe navigation and structure of the table.','1. Check the contents of the summary attribute for each data table.2. Determine if the summary describes navigation and structure of the table.','Success Criteria 1.3.1 Info and Relationships (A)',NULL,NULL,NULL),(204,'Known','input','The input element doesn\'t have associated label.','Add text to the input element\'s associated label that describes the purpose or function of the control.','Success Criteria 1.3.1 Info and Relationships (A)',NULL,NULL,NULL),(205,'Potential','input','input element, type of \"file\", label may not describe the purpose or function of the control.','1. All input elements, type of \"file\", have a label that describes the purpose or function of the control.','Success Criteria 3.3.2 Labels or Instructions (A)',NULL,NULL,NULL),(206,'Known','input','The input element doesn\'t have associated label.','Add text to the input element\'s associated label that describes the purpose or function of the control.','Success Criteria 1.3.1 Info and Relationships (A)',NULL,NULL,NULL),(207,'Known','input','The input element doesn\'t have associated label.','Add text to the input element\'s associated label that describes the purpose or function of the control.','Success Criteria 1.3.1 Info and Relationships (A)',NULL,NULL,NULL),(208,'Known','select','Label text is empty for select element.','Add text to the label associated with the select element.','Success Criteria 1.3.1 Info and Relationships (A)',NULL,NULL,NULL),(209,'Potential','select','select element\'s label is not positioned close to control.','1. The label must be positioned close to the control.','Success Criteria 1.3.1 Info and Relationships (A)',NULL,NULL,NULL),(210,'Potential','select','select element\'s label may not describe the purpose or function of the control.','1. All select elements have a label that describes the purpose or function of the control.','Success Criteria 3.3.2 Labels or Instructions (A)',NULL,NULL,NULL),(211,'Potential','input','input element label, type of \"text\", is not positioned close to control.','1. Check all input  elements that have a type attribute value of \"text\".2. View the input element within the document and check the positioning of its label.','Success Criteria 1.3.1 Info and Relationships (A)',NULL,NULL,NULL),(212,'Known','textarea','The textarea element doesn\'t have associated label.','Add text to the textarea element\'s associated label that describes the purpose or function of the control.','Success Criteria 1.3.1 Info and Relationships (A)',NULL,NULL,NULL),(213,'Known','input','The input element doesn\'t have associated label.','Add text to the input element\'s associated label that describes the purpose or function of the control.','Success Criteria 1.3.1 Info and Relationships (A)',NULL,NULL,NULL),(214,'Potential','textarea','textarea element label may not describe the purpose or function of the control.','1. All textarea elements have a label that describes the purpose or function of the control.','WCAG 2.0(AA)',NULL,NULL,NULL),(216,'Known','input','The input element doesn\'t have associated label.','Add text to the input element\'s associated label that describes the purpose or function of the control.','Success Criteria 1.3.1 Info and Relationships (A)',NULL,NULL,NULL),(217,'Potential','input','input element, type of \"password\", label may not describe the purpose or function of the control.','1. All input elements, type of \"password\", have a label that describes the purpose or function of the control.','Success Criteria 3.3.2 Labels or Instructions (A)',NULL,NULL,NULL),(218,'Potential','input','input element, type of \"text\", label may not describe the purpose or function of the control.','1. All input elements, type of \"text\", have a label that describes the purpose or function of the control.','Success Criteria 3.3.2 Labels or Instructions (A)',NULL,NULL,NULL),(219,'Potential','input','input element, type of \"checkbox\", label may not describe the purpose or function of the control.','1. All input elements, type of \"checkbox\", have a label that describes the purpose or function of the control.','Success Criteria 3.3.2 Labels or Instructions (A)',NULL,NULL,NULL),(220,'Potential','input','input element, type of \"radio\", label may not describe the purpose or function of the control.','1. All input elements, type of \"checkbox\", have a label that describes the purpose or function of the control.','Success Criteria 3.3.2 Labels or Instructions (A)',NULL,NULL,NULL),(221,'Known','body','Poor color contrast between text and background color.','Change either the text attribute value or the bgcolor attribute value of the body element so the luminosity contrast ratio is greater than 5:1','Success Criteria 1.4.1 Use of Colour (A)',NULL,NULL,NULL),(222,'Known','body','Poor color contrast between link text and background color.','Change either the link attribute value or the bgcolor attribute value of the body element so the luminosity contrast ratio is greater than 5:1','Success Criteria 1.4.1 Use of Colour (A)',NULL,NULL,NULL),(223,'Known','body','Poor color contrast between active link text and background color.','Change either the alink attribute value or the bgcolor attribute value of the body element so the luminosity contrast ratio is greater than 5:1','Success Criteria 1.4.1 Use of Colour (A)',NULL,NULL,NULL),(224,'Known','body','Poor color contrast between visited link text and background color.','Change either the vlink attribute value or the bgcolor attribute value of the body element so the luminosity contrast ratio is greater than 5:1','Success Criteria 1.4.1 Use of Colour (A)',NULL,NULL,NULL),(225,'Known','html','Strict doctype is not declared.','Insert a \'strict\' doctype declaration at the start of the document.','WCAG 2.0(AA)',NULL,NULL,NULL),(226,'Known','body','Poor contrast between text and background color (WAI ERT algorithm).','Change either the text attribute value or the bgcolor attribute value of the body element so the contrast surpasses the WAI ERT color algorithm threshold.','WCAG 2.0(AA)',NULL,NULL,NULL),(227,'Known','body','Poor contrast between link text and background color (WAI ERT algorithm).','Change either the link attribute value or the bgcolor attribute value of the body element so the contrast surpasses the WAI ERT color algorithm threshold.','WCAG 2.0(AA)',NULL,NULL,NULL),(228,'Known','body','Poor contrast between active link text and background color (WAI ERT algorithm).','Change either the alink attribute value or the bgcolor attribute value of the body element so the contrast surpasses the WAI ERT color algorithm threshold.','WCAG 2.0(AA)',NULL,NULL,NULL),(229,'Known','body','Poor contrast between visited link text and background color (WAI ERT algorithm).','Change either the vlink attribute value or the bgcolor attribute value of the body element so the contrast surpasses the WAI ERT color algorithm threshold.','WCAG 2.0(AA)',NULL,NULL,NULL),(230,'Potential','table','Table may require thead, tfoot and tbody elements to group repeated table row structures.','1. View the table and determine if thead, tfoot and tbody elements are required to group table row structures.','Success Criteria 1.3.1 Info and Relationships (A)',NULL,NULL,NULL),(231,'Potential','table','Table may require colgroup and col elements to group table columns.','1. View the table and determine if colgroup or col elements are required to group table column structures.','Success Criteria 1.3.1 Info and Relationships (A)',NULL,NULL,NULL),(232,'Known','html','Document does not validate.','Validate the document using a validator service.','WCAG 2.0(AA)',NULL,NULL,NULL),(233,'Known','frameset','frameset element used.','Remove the frameset element and modify the structure of your site.','WCAG 2.0(AA)',NULL,NULL,NULL),(234,'Known','frame','frame element used.','Remove the frame element and modify the structure of your site.','WCAG 2.0(AA)',NULL,NULL,NULL),(235,'Potential','body','The reading direction of all text may not be correctly marked','1. Examine the reading direction of text in the document.2. If the reading direction is right-to-left, check that for the nearest parent element that has a dir attribute, the attribute has the value \"rtl\".3. If the reading direction is left-to-right, check that there is no parent element with a dir attribute, or that for the nearest parent element that has a dir attribute, the attribute has the value \"ltr\".','WCAG 2.0(AA)',NULL,NULL,NULL),(236,'Known','a','Adjacent text and image link have the same destination.','Put the text and image together in one link, and provide null alternative text on the image to eliminate duplication of text.','WCAG 2.0(AA)',NULL,NULL,NULL),(237,'Known','html','form submit button label is not unique.','Change the label on the submit buttons so they are unique.','WCAG 2.0(AA)',NULL,NULL,NULL),(238,'Known','input','input element has alt attribute.','Remove the alt attribute from all input elements except those with a type attribute value of \"image\".','Success Criteria 1.1.1 Non-text Content (A)',NULL,NULL,NULL),(239,'Potential','img','img has title attribute and image may be decorative.','1. Check each img element and check for a title attribute.2. Determine if the image is decorative.3. Note: For this document, \"decorative\" is defined as \"content that does not provide information, functionality, sensory experience and is neither multimedia nor time-dependent interactive\".','Success Criteria 1.1.1 Non-text Content (A)',NULL,NULL,NULL),(240,'Potential','a','Text alternative for multimedia file may not tell the same story and present the same information as the multimedia file.','1. Check each a (anchor) element in the document.2. Check the href attribute value for a multimedia file extension.3. Common multimedia file extensions are .wmv, .mpg, .mov, .ram, and .aif.4. Find the text alternative file that is associated with the multimedia file.5. View the multimedia file and view the text alternative file.6. Check that the dialogue in the text alternative matches the dialogue in the multimedia presentation.7. Check that the text alternative has descriptions of sounds.8. Check that the text alternative has descriptions of setting and setting changes.9. Check that the text alternative has descriptions of actions and expressions of any \'actors\' (people, animals etc).','WCAG 2.0(AA)',NULL,NULL,NULL),(241,'Potential','body','The information are not organized well.','1. Check the text content of the document.2. Check for any information that is presented in a tabular manner.3. Unstructured tabular information is detected where multiple tab spaces, or multiple pipe characters are found in a single line.','Success Criteria 1.3.1 Info and Relationships (A)',NULL,NULL,NULL),(242,'Potential','caption','Table caption may not identify the table.','1. View the table and the caption.','Success Criteria 1.3.1 Info and Relationships (A)',NULL,NULL,NULL),(243,'Known','table','Table summary duplicates the table caption.','Change the table summary or caption.','Success Criteria 1.3.1 Info and Relationships (A)',NULL,NULL,NULL),(244,'Known','table','Data table with both row and column headers does not use scope to identify cells.','Add scope attributes to header cells so they identify the cells that relate to the header.','Success Criteria 1.3.1 Info and Relationships (A)',NULL,NULL,NULL),(245,'Known','table','Data table with more than one row/column of headers does not use id and headers attributes to identify cells.','Add id and headers attributes to table cells so they identify the cells that relate to the headers.','Success Criteria 1.3.1 Info and Relationships (A)',NULL,NULL,NULL),(246,'Potential','form','Required fields are not specified.','1. View the form.2. Determine which fields are required for submission of the form.3. Check if the required fields are indicated to the user as required.','Success Criteria 3.3.2 Labels or Instructions (A)',NULL,NULL,NULL),(247,'Known','form','Form missing fieldset and legend to group multiple checkbox buttons.','Add a fieldset and legend element to the form for each group of checkbox buttons.','Success Criteria 1.3.1 Info and Relationships (A)',NULL,NULL,NULL),(249,'Potential','body','Emphasized or special text may be missing semantic markup.','1. View the document text and determine if there is any emphasized or special text.2. Determine if there is markup used to indicate the emphasized or special text.3. Note: Semantic markup includes the elements em, strong, dfn, code, samp, kbd, var, cite, abbr, acronym, sub and sup.','WCAG 2.0(AA)',NULL,NULL,NULL),(250,'Potential','body','Text may refer to items by shape, size, or relative position alone.','1. View the document text and determine if there are references to other items in the document.2. Determine if the references use shape, size, or relative position alone.3. The references to other items must be indicated in ways that do not use visual perception.','Success Criteria 1.3.3 Sensory Characteristics (A)',NULL,NULL,NULL),(251,'Potential','img','Image may contain text with poor contrast.','1. Check if the image contains any text.2. If the image contains text, calculate the luminosity contrast ratio between the text and the background color.3. The luminosity contrast ratio can be determined using the following formula:4. (L1+.05) / (L2+.05) where L is luminosity and is defined as .2126*R + .7152*G + .0722B using linearized R, G, and B values. Linearized R (for example) = (R/FS)^2.2 where FS is full scale value (255 for 8 bit color channels). L1 is the higher value (of text or background) and L2 is the lower value.','Success Criteria 1.4.1 Use of Color (A)',NULL,NULL,NULL),(252,'Known','body','All text colors are not set.','Ensure all the text colors or none of the text colors are set using attributes on the body element.','Success Criteria 1.4.1 Use of Color (A)',NULL,NULL,NULL),(253,'Potential','img','This image may contain text with poor contrast.','1. Check if the image contains any text.2. If the image contains text, calculate the luminosity contrast ratio between the text and the background color.3. The luminosity contrast ratio can be determined using the following formula:4. (L1+.05) / (L2+.05) where L is luminosity and is defined as .2126*R + .7152*G + .0722B using linearized R, G, and B values. Linearized R (for example) = (R/FS)^2.2 where FS is full scale value (255 for 8 bit color channels). L1 is the higher value (of text or background) and L2 is the lower value.','Success Criteria 1.4.6 Contrast (Enhanced) (AAA)',NULL,NULL,NULL),(254,'Known','body','Poor color contrast between text and background color.','Change either the text attribute value or the bgcolor attribute value of the body element so the luminosity contrast ratio is greater than 10:1','WCAG 2.0(AA)',NULL,NULL,NULL),(255,'Known','body','Poor color contrast between link text and background color.','Change either the link attribute value or the bgcolor attribute value of the body element so the luminosity contrast ratio is greater than 10:1','WCAG 2.0(AA)',NULL,NULL,NULL),(256,'Known','body','Poor color contrast between active link text and background color.','Change either the alink attribute value or the bgcolor attribute value of the body element so the luminosity contrast ratio is greater than 10:1','WCAG 2.0(AA)',NULL,NULL,NULL),(257,'Known','body','Poor color contrast between visited link text and background color.','Change either the vlink attribute value or the bgcolor attribute value of the body element so the luminosity contrast ratio is greater than 10:1','WCAG 2.0(AA)',NULL,NULL,NULL),(258,'Potential','applet','applet may not provide a keyboard mechanism to return focus to the parent window.','1. Set keyboard focus to the applet.2. Determine if there is a keyboard mechanism to return keyboard focus to the parent window.3. Note: A common method of exiting an applet is to repeatedly press the \'tab\' key until the keyboard focus leaves the applet.','Success Criteria 2.1.2 No Keyboard Trap (A)',NULL,NULL,NULL),(259,'Potential','object','object may not provide a keyboard mechanism to return focus to the parent window.','1. Set keyboard focus to the object.2. Determine if there is a keyboard mechanism to return keyboard focus to the parent window.3. Note: A common method of exiting an object is to repeatedly press the \'tab\' key until the keyboard focus leaves the object.','Success Criteria 2.1.2 No Keyboard Trap (A)',NULL,NULL,NULL),(260,'Potential','embed','embed may not provide a keyboard mechanism to return focus to the parent window.','1. Set keyboard focus to the embed.2. Determine if there is a keyboard mechanism to return keyboard focus to the parent window.3. Note: A common method of exiting an embed is to repeatedly press the \'tab\' key until the keyboard focus leaves the embed.','Success Criteria 2.1.2 No Keyboard Trap (A)',NULL,NULL,NULL),(261,'Potential','body','Sections may not be marked with headers.','1. View the document content and find the major sections.2. Determine if there is a header prior to each section.','Success Criteria 2.4.10 Section Headings (AAA)',NULL,NULL,NULL),(262,'Potential','body','Groups of links with a related purpose are not marked.','1. View the document and find groups of links (anchor elements).2. Determine if the groups of links are related.3. Determine if the groups of links are marked.4. Note: Groups of links may be marked using the following elements: ul, ol, div or map.','Success Criteria 2.4.1 Bypass Blocks (A)',NULL,NULL,NULL),(263,'Potential','frameset','Repeated blocks of content may not appear in the same frame within the frameset.','1. View the document and note the content that appears in each frame.2. Navigage the site so content in the frameset changes.3. Determine if the same type of content appears in the same frame.','Success Criteria 3.2.3 Consistent Navigation (AA)',NULL,NULL,NULL),(264,'Known','input','input element, type of \"submit\", missing a tab index.','Add a tabindex attribute to your input element.','WCAG 2.0(AA)',NULL,NULL,NULL),(265,'Potential','form','Tab order may not follow logical order.','1. Check the HTML code to see if the tabindex attribute is used.2. Start at the beginning of the document and view the keyboard focus change as you enter tab characters.','Success Criteria 3.2.3 Consistent Navigation (AA)',NULL,NULL,NULL),(266,'Potential','body','Document may require a breadcrumb trail.','1. Check if the document will be part of a collection.2. Check if the document contains a breadcrumb trail.3. Note: All elements in the breadcrumb trail must be implemented as links except for the current location.','Success Criteria 2.4.8 Location (AAA)',NULL,NULL,NULL),(268,'Potential','form','Provide help for correcting the submitted errors.','1. Check all forms in the document.2. Fill out the form entering invalid data.3. Check that an error message is returned identifying the error with information that assists in correcting the error.4. The following are examples of information that assists in correcting the error:5. Examples of correct data entered into the form fields.6. Examples of correct data with directions on how to enter them into the form fields.7. A description of correct data.','Success Criteria 3.3.3 Error Suggestion (AA)',NULL,NULL,NULL),(269,'Potential','form','Form submission data may not be presented to the user before final acceptance of an irreversable transaction.','1. Check all forms in the document.2. Determine if the form submission is irreversable.3. Check if the user is shown the form data and can correct it before commiting the irreversable action.','Success Criteria 3.3.4 Error Prevention (Legal, Financial, Data) (AA)',NULL,NULL,NULL),(270,'Potential','body','Unicode right-to-left marks or left-to-right marks may be required.','1. Check all text in the document.2. Look for blocks of text where the reading direction changes.3. Check if neutral characters such as spaces or punctuation occur adjacent to text that is rendered in the non-default direction.4. Check if the HTML bidirectional algorithm would produce the wrong placement of the neutral characters5. Check if the neutral characters are followed by Unicode right-to-left or left-to-right marks that cause neutral characters to be placed as part of the preceding characters.','Success Criteria 1.3.1 Info and Relationships (A)',NULL,NULL,NULL),(271,'Potential','body','dir attribute may be required to identify changes in text direction.','1. Check all text in the document.2. Determine if there are blocks of text that are not in the primary document language.3. Determine if the blocks of text have a reading order that is different from the primary language.4. Check if the blocks of text are marked using the dir attribute.','Success Criteria 1.3.1 Info and Relationships (A)',NULL,NULL,NULL),(272,'Potential','form','Form may delete information without allowing for recovery.','1. Use the form to delete information on the server.2. Check if there is a mechanism for recovering the information.','Success Criteria 3.3.4 Error Prevention (Legal, Financial, Data) (AA)',NULL,NULL,NULL),(273,'Known','html','Right to left reading order not marked or marked incorrectly.','Add a dir attribute to your html element.','Success Criteria 3.1.1 Language of Page (A)',NULL,NULL,NULL),(274,'Potential','all elements','Change of context may occur without user activation.','1. Move the keyboard focus through all document content.2. Watch for new windows to appear.3. If change of focus causes new window to appear check if there is a warning message to user.','Success Criteria 3.2.2 On Input (A)',NULL,NULL,NULL),(275,'Potential','body','Loading web page may cause new window to open.','1. Determine which technologies are required by the page.2. Ensure all the technologies required by the page are present and turned on.3. Load the web page and check if any new windows were opened.','Success Criteria 3.2.1 On Focus (A)',NULL,NULL,NULL),(276,'Potential','body','Repeated components may not appear in the same relative order each time they appear.','1. Determine which components are repeated on all pages within the site.2. Check that the components appear in the same relative order on this page.','Success Criteria 3.2.3 Consistent Navigation (AA)',NULL,NULL,NULL),(301,'Known','all elements','The contrast between the colour of text and its background for the element is not sufficient  to meet WCAG2.0 Level AA.','Use a colour contrast evaluator to determine if text and background colours provide a contrast ratio of 4.5:1 for standard text, or 3:1 for larger text. Change colour codes to produce sufficient contrast.','Success Criteria 1.4.3 Contrast (Minimum) (AA)',NULL,NULL,NULL),(302,'Known','a','The contrast between the colour of visited link text and its background for the element is not sufficient  to meet WCAG2.0 Level AA.','Use a colour contrast evaluator to determine if text and background colours provide a contrast ratio of 4.5:1 for standard text, or 3:1 for larger text. Change colour codes to produce sufficient contrast.','Success Criteria 1.4.3 Contrast (Minimum) (AA)',NULL,NULL,NULL),(303,'Known','a','The contrast between the colour of active link text and its background is not sufficient to meet WCAG2.0 Level AA.','Use a colour contrast evaluator to determine if active link text and background colours provide a contrast ratio of 4.5:1 for standard text, or 3:1 for larger text. Change colour codes to produce sufficient contrast.','Success Criteria 1.4.3 Contrast (Minimum) (AA)',NULL,NULL,NULL),(304,'Known','a','The contrast between the colour of selected link text and its background is not sufficient to meet WCAG2.0 Level AA.','Use a colour contrast evaluator to determine if selected link text and background colours provide a contrast ratio of 4.5:1 for standard text, or 3:1 for larger text. Change colour codes to produce sufficient contrast.','Success Criteria 1.4.3 Contrast (Minimum) (AA)',NULL,NULL,NULL),(305,'Known','a','The contrast between the colour of link text and its background is not sufficient to meet WCAG2.0 Level AA.','Use a colour contrast evaluator to determine if link text and background colours provide a contrast ratio of 4.5:1 for standard text, or 3:1 for larger text. Change colour codes to produce sufficient contrast.','Success Criteria 1.4.3 Contrast (Minimum) (AA)',NULL,NULL,NULL),(306,'Known','all elements','The contrast between the colour of text and its background is not sufficient to meet WCAG2.0 Level AAA.','Use a colour contrast evaluator to determine if text and background colours provide a contrast ratio of 7:1 for standard text, or 4.5:1 for larger text. Change colour codes to produce sufficient contrast.','Success Criteria 1.4.3 Contrast (Minimum) (AA)',NULL,NULL,NULL),(307,'Known','a','The contrast between the colour of visited link text and its background is not sufficient to meet WCAG2.0 Level AAA.','Use a colour contrast evaluator to determine if text and background colours provide a contrast ratio of 7:1 for standard text, or 4.5:1 for larger text. Change colour codes to produce sufficient contrast.','Success Criteria 1.4.3 Contrast (Minimum) (AA)',NULL,NULL,NULL),(308,'Known','a','The contrast between the colour of active link text and its background is not sufficient to meet WCAG2.0 Level AAA.','Use a colour contrast evaluator to determine if text and background colours provide a contrast ratio of 7:1 for standard text, or 4.5:1 for larger text. Change colour codes to produce sufficient contrast.','Success Criteria 1.4.3 Contrast (Minimum) (AA)',NULL,NULL,NULL),(309,'Known','a','The contrast between the colour of selected link text and its background is not sufficient to meet WCAG2.0 Level AAA.','Use a colour contrast evaluator to determine if text and background colours provide a contrast ratio of 7:1 for standard text, or 4.5:1 for larger text. Change colour codes to produce sufficient contrast.','Success Criteria 1.4.3 Contrast (Minimum) (AA)',NULL,NULL,NULL),(310,'Known','a','Link text colour must provide high contrast with its background colour.','Use a colour contrast evaluator to determine if text and background colours provide a contrast ratio of 7:1 for standard text, or 4.5:1 for larger text. Change colour codes to produce sufficient contrast.','Success Criteria 1.4.3 Contrast (Minimum) (AA)',NULL,NULL,NULL);
